import React, { Component } from 'react';
import Project from './Project/Project';

class Projects extends Component {
    constructor() {
        super();
        this.state = {
            data: {
                head : ["Burger Builder","Facial Recognition","Loan Prediction"],
                description: ["Burger Builder content","Facial Recognition content","Loan Prediction content"]
            }
        };
    }   
  
    render() {
        return (
        <div>
            <Project props={this.state.data} />
        </div>
        );
    }
}
export default Projects;
